import React from 'react';

import Demo from './components/Demo'

const story = {
    title: 'Demo',
}

export default story

export const DateDemo = () => (
    <Demo
        label="Please enter a date:"
        mask={[
            /\d/, /\d/, ' ', '-', ' ', /\d/, /\d/, ' ', '-', ' ', /\d/, /\d/, /\d/, /\d/
        ]}
        placeholder="DD - MM - YYYY"
    />
)

export const TelephoneDemo = () => (
    <Demo
        label="Please enter a telephone number:"
        mask={[
            '(', /\d/, /\d/, /\d/, ')', '-', /\d/, /\d/, /\d/, '-', /\d/, /\d/, /\d/, /\d/,
        ]}
        placeholder="_"
    />
)

export const PostalCodeDemo = () => (
    <Demo
        label="Please enter a postal code:"
        mask={[
            /[a-z]/i, /\d/, /[a-z]/i, ' ', /\d/, /[a-z]/i, /\d/, 
        ]}
        placeholder="_"
    />
)

export const DecimalDemo = () => (
    <Demo
        label="Please enter a decimal:"
        mask={[
            /[\d]/, '.', /[\d]/
        ]}
        placeholder="_"
    />
)
